import React from 'react';
import './Gamebox.css';

function Gamebox({ onStartGame }) {
  const human = () => {
    alert("coming soon");
  };

  const invite = () => {
    alert("Invite your friend");
  };

  return (
    <div className='game'>
      <div className='game-container'>
        <p id="X">X <span id='O'>O</span></p>
        <div className='pickPlayer'>
          PICK PLAYER<br />
          <div>
            <button className='button1' onClick={() => onStartGame('X')}>X</button>
            <button className='button2' onClick={() => onStartGame('O')}>O</button>
          </div>
        </div>
        <button className='cpu'>NEW GAME(VS CPU)</button>
        <button className='human' onClick={human}>NEW GAME(VS HUMAN) <span>Coming soon</span></button>
        <button className='invite' onClick={invite}>Invite your friend</button>
      </div>
    </div>
  );
}

export default Gamebox;
